"use strict";

var canvas = document.createElement('canvas');
document.body.appendChild(canvas);
canvas.width = 1000;
canvas.height = 1000;
var context = canvas.getContext('2d');
var width = canvas.width;
var height = canvas.height;
var image_data = context.createImageData(width, height);
var data = image_data.data;
var zoom = .5;



var e_data, e_width, e_height;
var e = new Image();
// Load image of Albert Einstein
e.src = 'data:image/jpeg;base64,';
e.onload = function() {
	var e_canvas = document.createElement('canvas');
	e_canvas.width = e.width;
	e_canvas.height = e.height;
	e_width = e.width;
	e_height = e.height;
	var e_context = e_canvas.getContext('2d');
	e_context.drawImage(e, 0, 0);
	var e_image_data = e_context.getImageData(0, 0, e.width, e.height);
	e_data = e_image_data.data;
	console.log('Loaded image');
};

var observer = {
	position: [0, 0, 0],
	t_axis: [1, 0, 0],
	x_axis: [0, 1, 0],
	y_axis: [0, 0, 1]
};

function render()
{
	var position = new Array(3);

    if (!document.webkitFullscreenElement) {
        canvas.width = window.innerWidth;
        canvas.height = window.innerHeight;
        width = canvas.width;
        height = canvas.height;
		image_data = context.createImageData(width, height);
		data = image_data.data;
    }

	console.log('Rendering...');
    var index = 0;
    for (var j = 0; j < height; ++j) {
        for (var i = 0; i < width; ++i) {
            var x = (i - width/2) / zoom;
            var y = -(j - height/2) / zoom;

			//var position = add(observer.position, add(scale(observer.x_axis, x), scale(observer.y_axis, y)));
            //position = project_light_cone(position);
            // Now inlining all of this to improve performance

            position[0] = observer.x_axis[0] * x + observer.y_axis[0] * y;
            position[1] = observer.x_axis[1] * x + observer.y_axis[1] * y;
            position[2] = observer.x_axis[2] * x + observer.y_axis[2] * y;

            var t2 = observer.t_axis[0] * observer.t_axis[0];
            t2 -= observer.t_axis[1] * observer.t_axis[1];
            t2 -= observer.t_axis[2] * observer.t_axis[2];

            var pt = position[0] * observer.t_axis[0];
            pt -= position[1] * observer.t_axis[1];
            pt -= position[2] * observer.t_axis[2];

            var p2 = position[0] * position[0];
            p2 -= position[1] * position[1];
            p2 -= position[2] * position[2];

			var parameter = (-pt - Math.sqrt(pt * pt - t2 * p2)) / t2;

            position[0] += observer.position[0] + observer.t_axis[0] * parameter;
            position[1] += observer.position[1] + observer.t_axis[1] * parameter;
            position[2] += observer.position[2] + observer.t_axis[2] * parameter;
            
            if (position[1] > 0 && -position[2] > 0 && position[1] < e_width && -position[2] < e_height) {
            	var e_i = Math.floor(position[1]);
            	var e_j = Math.floor(-position[2]);

            	var e_index = (e_i + e_j * e_width) * 4;
            	data[index++] = e_data[e_index++];
            	data[index++] = e_data[e_index++];
            	data[index++] = e_data[e_index++];
            	data[index++] = 255;

            	continue;
            }
        	
        	data[index++] = 0;
        	data[index++] = 0;
        	data[index++] = 0;
        	data[index++] = 255;

            /*
            var value;
            if (position[1] > -100 && position[1] < 100 && position[2] > -100 && position[2] < 100) {
            	value = Math.sin(position[0] / 10) * Math.sin(position[0] / 10);
            }
            else {
            	value = 0;
            }

            data[index++] = 255 * value;
            data[index++] = 0;
            data[index++] = 0;
            data[index++] = 255;
            */
        }
    }
    context.putImageData(image_data, 0, 0);
    window.scrollTo(
        document.documentElement.scrollWidth/2 - window.innerWidth/2, 
        document.documentElement.scrollHeight/2 - window.innerHeight/2
    );
}

addEventListener('mousewheel', function(event) {
    zoom *= Math.exp(-event.wheelDelta / 1000);
    event.preventDefault();
});

var keys = {};
addEventListener('keydown', function(event) {
    keys[event.which] = true;    
});
addEventListener('keyup', function(event) {
    keys[event.which] = false;
});
var key_w = 87;
var key_a = 65;
var key_s = 83;
var key_d = 68;

var rapidity = .02;
function update() {
	observer.position = add(observer.position, scale(observer.t_axis, 3));

	if (keys[key_d]) {
		var direction1 = observer.t_axis;
		var direction2 = observer.x_axis;
		observer.t_axis = boost(observer.t_axis, direction1, direction2, rapidity);
		observer.x_axis = boost(observer.x_axis, direction1, direction2, rapidity);
		observer.y_axis = boost(observer.y_axis, direction1, direction2, rapidity);
	}
	if (keys[key_a]) {
		var direction1 = observer.t_axis;
		var direction2 = scale(observer.x_axis, -1);
		observer.t_axis = boost(observer.t_axis, direction1, direction2, rapidity);
		observer.x_axis = boost(observer.x_axis, direction1, direction2, rapidity);
		observer.y_axis = boost(observer.y_axis, direction1, direction2, rapidity);
	}
	if (keys[key_w]) {
		var direction1 = observer.t_axis;
		var direction2 = observer.y_axis;
		observer.t_axis = boost(observer.t_axis, direction1, direction2, rapidity);
		observer.x_axis = boost(observer.x_axis, direction1, direction2, rapidity);
		observer.y_axis = boost(observer.y_axis, direction1, direction2, rapidity);

	}
	if (keys[key_s]) {
		var direction1 = observer.t_axis;
		var direction2 = scale(observer.y_axis, -1);
		observer.t_axis = boost(observer.t_axis, direction1, direction2, rapidity);
		observer.x_axis = boost(observer.x_axis, direction1, direction2, rapidity);
		observer.y_axis = boost(observer.y_axis, direction1, direction2, rapidity);
	}

	requestAnimationFrame(render);
}
var fps = 60;
setInterval(update, 1000 / fps);




function boost(vector, direction1, direction2, angle) {
	var component1 = inner(vector, direction1);
	var component2 = -inner(vector, direction2);
	var vector1 = subtract(direction1, component1);
	var vector2 = subtract(direction2, component2);
	var vector_fixed = subtract(vector, add(vector1, vector2));
	var component1_rotated = component1 * Math.cosh(angle) + component2 * Math.sinh(angle);
	var component2_rotated = component1 * Math.sinh(angle) + component2 * Math.cosh(angle);
	var vector1_rotated = subtract(direction1, component1_rotated);
	var vector2_rotated = subtract(direction2, component2_rotated);
	var vector_rotated = add(vector1_rotated, vector2_rotated);
	return add(vector_rotated, vector_fixed);
}


function project_light_cone(position) {
	var displacement = subtract(position, observer.position);
	var parameter = (-inner(displacement, observer.t_axis) - Math.sqrt(square(inner(observer.t_axis, displacement)) - inner(observer.t_axis, observer.t_axis) * inner(displacement, displacement))) / inner(observer.t_axis, observer.t_axis);
	return add(observer.position, add(displacement, scale(observer.t_axis, parameter)));
}




function square(x) {
	return x * x;
}

function add(vector, vector2) {
	var result = [];
	for (var i = 0; i < vector.length; ++i) {
		result[i] = vector[i] + vector2[i];
	}
	return result;
}

function subtract (vector1, vector2) {
	var result = [];
	for (var i = 0; i < vector1.length; ++i)
	{
		result[i] = vector1[i] - vector2[i];
	}
	return result;
}

function scale(vector, scalar) {
	var result = [];
	for (var i = 0; i < vector.length; ++i) {
		result[i] = vector[i] * scalar;
	}
	return result;
}

function inner(vector1, vector2) {
	var result = vector1[0] * vector2[0];
	for (var component = 1; component < vector1.length; ++component)
	{
		result -= vector1[component] * vector2[component];
	}
	return result;
}

function boost(vector, direction1, direction2, angle)
{
	var component1 = inner(vector, direction1);
	var component2 = -inner(vector, direction2);
	var vector1 = scale(direction1, component1);
	var vector2 = scale(direction2, component2);
	var vector_fixed = subtract(vector, add(vector1, vector2));
	var component1_rotated = component1 * Math.cosh(angle) + component2 * Math.sinh(angle);
	var component2_rotated = component1 * Math.sinh(angle) + component2 * Math.cosh(angle);
	var vector1_rotated = scale(direction1, component1_rotated);
	var vector2_rotated = scale(direction2, component2_rotated);
	var vector_rotated = add(vector1_rotated, vector2_rotated);
	return add(vector_rotated, vector_fixed);
}

function rotate(vector, direction1, direction2, angle) {
	var component1 = inner(vector, direction1);
	var component2 = inner(vector, direction2);
	var vector1 = scale(direction1, component1);
	var vector2 = scale(direction2, component2);
	var vector_fixed = subtract(vector, add(vector1, vector2));
	var component1_rotated = component1 * Math.cos(angle) - component2 * Math.sin(angle);
	var component2_rotated = component1 * Math.sin(angle) + component2 * Math.cos(angle);
	var vector1_rotated = scale(direction1, component1_rotated);
	var vector2_rotated = scale(direction2, component2_rotated);
	var vector_rotated = add(vector1_rotated, vector2_rotated);
	return add(vector_rotated, vector_fixed);
}